          name="name"
          value={newContact}
          onChange={handleName}
        />
      </label>
      <label>
        Phone number:
        <input
          type="number"
          name="number"
          value={newContact}
          onChange={handleName}
        />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
};

export default Form;
